const canvas = document.getElementById("canvas01");
const ctx = canvas.getContext("2d");
canvas.width = 800;
canvas.height = 450;

const image1 = new Image();

// image1.src = "bali.jpg";

image1.src = "data:image/jpeg;base64,"

// This turns the colored image into a greyscale image
image1.addEventListener("load", function() {
  ctx.drawImage(image1, 0, 0);
  const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
  console.log(scannedImage);
  const scannedData = scannedImage.data;
  for(let i = 0; i < scannedData.length; i += 4) // 4 because: Every item in the array stands for RGBA (which counts: 1,2,3,4)
  {
      const total = scannedData[i] + scannedData[i + 1] + scannedData[i + 2];
      // const total = red + green + blue;
      const averageColorValue = total/3;

        scannedData[i] = averageColorValue; // red
        // scannedData[i + 1] = averageColorValue +10 -> Adding values would colorize the image
        scannedData[i + 1] = averageColorValue; // green
        scannedData[i + 2] = averageColorValue; // blue
  }
  scannedImage.data = scannedData;
  ctx.putImageData(scannedImage, 0, 0);
});